#include<bits/stdc++.h>
using namespace std;

const int M = 101;
int arr[M] = {0};

int main()
{
    ios_base::sync_with_stdio(false);
    cin.tie(NULL);
    cout.tie(NULL);
    int n, m;
    cin >> n;
    
    for (int i = 0; i < n; i++) {
        cin >> m;
        arr[m]++;
    }
    
    for (int i = 0; i < 101; i++) {
        if (arr[i] > 0) {
            for (int j = 0; j < arr[i]; j++) {
                cout << i << " ";
            }
        }
    }
}
